import React, { useState } from 'react';
import { Routes, Route, Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import PendingMembers from './PendingMembers';
import MemberActivation from './MemberActivation';
import MemberLookup from './MemberLookup';
import EditMember from './EditMember';
import QuotaAdjustment from './QuotaAdjustment';
import PropertyManagement from './PropertyManagement';
import CottageManagement from './CottageManagement';
import MaintenanceBlocking from './MaintenanceBlocking';
import InventoryHealth from './InventoryHealth';
import ApprovalQueue from './ApprovalQueue';
import BookingDecision from './BookingDecision';
import HolidayConfiguration from './HolidayConfiguration';
import PeakSeasonManagement from './PeakSeasonManagement';
import './AdminDashboard.css';

const AdminDashboard: React.FC = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  if (user?.role !== 'admin') {
    return <div>Access Denied</div>;
  }

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <div className="dashboard">
      <nav className="dashboard-nav">
        <h1>Vanatvam Admin</h1>
        <div className="nav-links">
          <Link to="/admin/pending-members" style={{fontWeight: 'bold', backgroundColor: '#34495e'}}>üìã Pending Members</Link>
          <Link to="/admin/member-lookup">üîç Member Lookup</Link>
          <Link to="/admin/quota-adjustment">üí∞ Quota Adjustment</Link>
          <Link to="/admin/properties">üè† Properties</Link>
          <Link to="/admin/cottages">üè° Cottages</Link>
          <Link to="/admin/maintenance">üîß Maintenance</Link>
          <Link to="/admin/inventory-health">üìä Inventory Health</Link>
          <Link to="/admin/approval-queue">‚úÖ Approval Queue</Link>
          <Link to="/admin/holidays">üéâ Holidays</Link>
          <Link to="/admin/peak-seasons">üìÖ Peak Seasons</Link>
        </div>
        <div className="user-info">
          <span>{user?.name}</span>
          <button onClick={handleLogout} className="btn btn-secondary">Logout</button>
        </div>
      </nav>
      <div className="dashboard-content">
        <Routes>
          <Route path="pending-members" element={<PendingMembers />} />
          <Route path="activate-member/:userId" element={<MemberActivation />} />
          <Route path="member-lookup" element={<MemberLookup />} />
          <Route path="quota-adjustment" element={<QuotaAdjustment />} />
          <Route path="properties" element={<PropertyManagement />} />
          <Route path="cottages" element={<CottageManagement />} />
          <Route path="maintenance" element={<MaintenanceBlocking />} />
          <Route path="inventory-health" element={<InventoryHealth />} />
          <Route path="approval-queue" element={<ApprovalQueue />} />
          <Route path="booking-decision/:bookingId" element={<BookingDecision />} />
          <Route path="holidays" element={<HolidayConfiguration />} />
          <Route path="peak-seasons" element={<PeakSeasonManagement />} />
          <Route path="" element={<div className="card"><h2>Welcome to Admin Dashboard</h2></div>} />
        </Routes>
      </div>
    </div>
  );
};

export default AdminDashboard;
